        "painter": 4906,
        "path": "del2",
        "custom": 0,
        "comment": "Represents a role-playing character developed by a friend.  The clothes are built up with epoxy putty and model magic filler (a light weight filler made for R/C aircraft).  The swords were ground useing a 1' belt sander from 1/4\" brass bar stock with guards carved from .06 sheet styrene and pommels made form decorative necklace beads.  The jewel on the necklace is a red marker lens (available wutg nodel railroad supplies).  The figure was painted using Model Master Acrylic, Tamiya and Gunze Sanyo paints."
