        "custom": 0,
        "comment": "Heavy metal was a real challenge to build it was a lot of fun.\nAll the floors and walls that apper in the fictures are stratch built using \nsimtra ain plastic sells it.  The store is in new york city.  the next pics i \nsend will include lights.  Some of my work can be seen at \namok time inc. in long island new york i will also be at the chiller theater \nshow at the amok time table.  Look for neo new york. \n\n"
