        "custom": 0,
        "comment": "The model is counter-shaded, that is dark on top and light on bottom, like the 2nd edition cover of Miller's graphic novel. It's also lit from the bottom and the background is run through Photoshop.\nFigure is airbrushed in acrylics. Base has pastels for weathering."
