        "comment": "It takes quite a bit of Milliput and sanding to get this kit streamlined, but I think I makes a very dynamic kit. Difficult to photograph because of all the reflections, which give it a tint. Kit is sprayed with Auto Acrylic Chrome spray and washed with black acrylic."
