        "comment": "GEOmetric Designs's \"Talos\" was apparently only available at GEO booths at conventions.  I picked mine up at Wonderfest '96 and just got around to building it in the summer of '99.  The paint scheme is very simple, bronze that's gone \"blue\" in spots, and is really a lot more subtle than it photographed.  The base is from a Revell Velociraptor \"JP-The Lost World\" kit and, yes, the lens-flare is done with Photoshop.\n--Truck"
