        "painter": 5561,
        "path": "Pegalis",
        "custom": 0,
        "comment": "On a quest to capture all of the Billiken Kaiju kits, I decide I must bite the bullet and land the goofiest looking one of all...or maybe that was the one with a clam for a head...but, seriously, Peguila is a monster from the old Japanese T.V. show \"Ultra-Q\" which was the forerunner of \"Ultraman\" and can only be described as \"X-Files with giant monsters\".  The suit was reused in an episode of \"Ultraman\", \"disguised\" with an extra horn on it's head...anyhow, he's done in grays and purples, and, in painting him, I learned never to use an airbrush outside on a day where the temp. is over 100 degrees F., windless or not...paint was drying before it hit the kit...--Truck"
