        "updated": "2004-02-20 21:35:26",
        "kit": 4941,
        "painter": 5771,
        "path": "beholder",
        "custom": 0,
        "comment": "<B>Based on the many eyed Beholder monster from <font color=red>Advanced Dungeons and Dragons</font>. I created this out of various materials I had hanging around.\r\nThe core is a styrofoam ball while the covering is <font color=blue>Model Magic</font> by <font color=green>Crayola</font> (neat stuff).  \r\nBase is made of many different materials and depict treasures collected for and by this creature. \r\nDrips of resin simulate drool and slime. Painted in acrylics with a dark wash. <BR>\r\nAbout 3\" across and the base is 8\"x8\".\r\nI plan on producing a small kit similar to this. <BR>\r\n<BR>My others: \r\n<A HREF=http://www.gremlins.com/garage/galleryView.jsp?buildupUid=2407> <IMG SRC=http://www.gremlins.com/phillip_besio/greenbeholder_icon.gif alt=\"Baby Green Beholder - 1st one produced\" align=middle></a>\r\n<A HREF=http://www.gremlins.com/garage/galleryView.jsp?buildupUid=2347><IMG SRC=http://www.gremlins.com/phillip_besio/bluebeholder_icon.gif alt=\"Baby Blue Beholder - 2nd one produced\" align=middle></a>\r\n<A HREF=http://www.gremlins.com/garage/galleryView.jsp?buildupUid=2319><img src=http://www.gremlins.com/phillip_besio/beholder_icon.gif alt=\"Hatchling Beholder - 3rd one produced\" align=middle></a>\r\n<A HREF=http://www.gremlins.com/garage/galleryView.jsp?buildupUid=2326><img src=http://www.gremlins.com/phillip_besio/redbeholder_icon.gif alt=\"Red Beholder - 4th one produced\" align=middle></a>\r\n<A HREF=http://www.gremlins.com/garage/galleryView.jsp?buildupUid=2605><IMG SRC=http://www.gremlins.com/phillip_besio/greenbeholder2_icon.gif alt=\"Green Beholder - 5th one produced\" align=middle></a>\r\n<A HREF=http://www.gremlins.com/garage/galleryView.jsp?buildupUid=3042><IMG SRC=http://www.gremlins.com/phillip_besio/mottled_icon.gif alt=\"Mottled Beholder - 6th one produced\" align=middle></a>\r\n<HR>More info write:<A HREF=mailto:trekist@hotmail.com>trekist@hotmail.com</a><BR>pics are being updated"
