        "painter": 5765,
        "path": "resiniria",
        "custom": 0,
        "comment": "My first 1/6 kit.  Absolutely lovely.  I really enjoyed painting this kit.  I did subtle grey shading on the armour.  I figured that with such a finely detailed kit, it would be a shame not to give that armour more attention!  The black lining defining the armoured plates were done with a fine brush with titanium white touch ups.  I should've used a Gundam Marker because we all know how much fun it is to get a nice even coat of white over black!  Oh well, live and learn.  "
