        "painter": 6107,
        "path": "Ghost",
        "custom": 0,
        "comment": "Although this kit came pre-assembled and painted, I'm the maniac who put the time and care into replacing the original boring white wires with glowing E.L.  Not a simple task.  Although the paint job it came with was really nice in most areas it was absolutely horrible in all the flesh zones so I went in and did a fair amount of shading and retouching.  Now they are perfect.  \r\n\r\nI'm hoping that some other builders will see this and jump on the E.L. bandwagon.  Hmmmmm, lightsabers that look and glow like lightsabers, instrument panels?  Lot's of posibilities.\r\n\r\nCheck out my web page for better pictures.  Also, if you want to know where to get E.L. wire then try Coolight.com"
