        "updated": "2003-03-19 00:42:20",
        "kit": 5523,
        "painter": 5367,
        "path": "Lancaster",
        "custom": 0,
        "comment": "Where to start with this kit? It's by Airfix and was very dissapointing quality wise. Once I started work on it though my interest rose. It's a 1:72 scale model and was going well until a box fell on it and broke the wheels off. So I damaged the wing area with a burned out propeller and shot up wing as disguise. Bullet holes and warped propeller supplied by a candle and a compass.\r\nThe painting instructions were from the 70's and only listed humbrol numbers which was'nt much help so you need a color reference.\r\nJust to say to all the modellers interested in Historical or Military kits you should have a browse over at the www.totalmodel.com community."
