        "comment": "The quality is excellent, all I had to do was drill the heel to fix her to the base, plus a bit of sanding on the legs.\r\nI painted her mostly with my new Iwata Eclipse airbrush, the best one I ever bought.\r\nThe model is very impressive and the photo dpoesnt really do it justice."
