        "comment": " The Willis Harold \"Obie\" O'Brien life cast\nmemoriam piece was created from a partial\nfacial casting made of Mr. O'Brien apparently\nsometime in the 1940's. The complete kit\ncomes in three pieces. The resin lifecast \nprepainted in a bronze finish, the oak stained\nand laquered display plaque, and the custom\nengraved brass nameplate. This piece is limited\nto 100 sets with 50% of the proceeds being donated\nthe L.A. Motion Picture Hospital in the name\nof Willis and Darlyne O'Brien.",
