        "updated": "1998-09-22 14:18:03",
        "name": "Earth vs. The Flying Saucers 3\" Animating Saucer",
        "scale": 52,
        "material": 6,
        "parts": 8,
        "genre": 12,
        "sculptor": 5241,
        "producer": 5241,
