        "shipping": 5,
        "available": 0,
        "released": null,
        "discontinued": null,
        "comment": " This re-issue piece was created from one of\nthe original 3\" stop-motion saucers from the\nmovie. It was taken apart before molding and\neach piece was mold and cast seperately so when\nit is assembled the disks turn and spin just\nlike the real stop-motion prop. This our\nfirst tribute piece to Ray Harryhausen comes endorsed by\nRay and is licensed through Columbia Pictures.",
